(1, 103, 'carnaval-warm-winter-fashion-in-bandung-2019', 1, 1, 'Carnaval Warm Winter Fashion in Bandung 2019', '2019-10-19', '2019-12-31', '00:00:00', '00:00:00', 0, '2019-10-18 17:00:00', '2019-12-30 17:00:00', 'Asia/Jakarta', '<p style=\"text-align: right;\"><img class=\"size-medium wp-image-77 alignright\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/3-1-300x200.jpg\" alt=\"\" width=\"300\" height=\"200\" />Carnaval Fashion Spring Event 2019 akan segera diadakan di Jakarta tepatnya di Callibar mall lho! Akan banyak pameran juga store fashion! Jangan sampai ketinggalan, buruan beli tiketnya!</p>\r\n<p style=\"text-align: right;\">[wpdevart_countdown text_for_day=\"Days\" text_for_hour=\"Hours\" text_for_minut=\"Minutes\" text_for_second=\"Seconds\" countdown_end_type=\"time\" end_date=\"13-02-2019 23:59\" start_time=\"1550040474\" end_time=\"90,24,60\" action_end_time=\"hide\" content_position=\"center\" top_ditance=\"10\" bottom_distance=\"10\" ]Acara selesai![/wpdevart_countdown]</p>', 1, '2019-10-19', '00:00:00', 0, 0, 0, 1, NULL, '2019-02-13 06:52:35', '2019-02-13 07:09:35', NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0);
