(56, 1, '2019-02-13 04:26:26', '2019-02-13 04:26:26', '<h1>GLOBAL FASHION 2017</h1>		\n			<figure><a href=\"http://localhost/wordpress/\"><img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/icon-menu-150x150.png\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2019/02/icon-menu-150x150.png 150w, http://localhost/wordpress/wp-content/uploads/2019/02/icon-menu.png 224w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a></figure>		\n		https://www.youtube.com/watch?v=DdDVL6rijAkhttps://www.youtube.com/watch?v=jjwA6gc3nEY		\n			<h2><a href=\"https://youtu.be/jjwA6gc3nEY\">Michael Cinco Catwalk at London 2016</a></h2>		\n		https://www.youtube.com/watch?v=UrFg4j-ctio		\n			<h2><a href=\"https://youtu.be/UrFg4j-ctio\">Tom Ford Fall Winter at Paris 2017</a></h2>		\n			<h2>It\'s time to work it out </h2>		\n		<p>FitFlex\'s Top skilled trainers will get you in shape. Reachthe perfectfit with the outfit you\'ve alwayswanted</p>		\n			<a href=\"#\" role=\"button\">\n						count me in\n					</a>\n			<figure><img width=\"143\" height=\"143\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/22.png\" alt=\"\" /></figure><h3>Foot work</h3><p>Walking, running, climbing. Your feet will be put to the test.</p>		\n			<figure><img width=\"143\" height=\"143\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/21.png\" alt=\"\" /></figure><h3>Heart rate</h3><p>The fastest way to reach results is to monitor the progress you make.</p>		\n			<figure><img width=\"143\" height=\"143\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/20.png\" alt=\"\" /></figure><h3>Weight lifting</h3><p>By slowly raising the weight bar, we are able to built muscles safely.</p>		\n			<h3>Featured Classes</h3>		\n			<h2>Strength & stamina</h2>		\n		<p>InFitFlex\'s Strength and Stamina class, we will delve deep into building the fittest body you can.The classaims to not only shape you up, but also instruct and inform you in the right methods to do weightlifting and working out.</p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>\n			<h2>Flexibility postures</h2>		\n		<p>Learn how to maintain a comfortableand healthyposture, with our comprehensive class that goes through the most popularYoga and Pilates postures. These postures are gears to make your body more flexibile and agile.</p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>\n			<h2>achieving your goals</h2>		\n		<p>Getting in shape forces you to face your biggest challenges, and sticking to a regular routine for a long period of time. This class will make sure you know how to focus on the right exercises and workouts to reach your goals.</p>		\n			<a href=\"#\" role=\"button\">\n						Sign up\n					</a>\n			<h3>What Our Custumers say</h3>		\n										<img width=\"204\" height=\"204\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/1.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2019/02/1.jpg 204w, http://localhost/wordpress/wp-content/uploads/2019/02/1-150x150.jpg 150w\" sizes=\"(max-width: 204px) 100vw, 204px\" />											\n				<p>\n					I\'ve managed to stay with  FitFlex 3 times a week, for over 6 months now, and I owe it all to the classes that make you fall in love with the process.\n				</p>\n				<p>Lizzie Thompson</p>\n										<img width=\"204\" height=\"204\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/2.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2019/02/2.jpg 204w, http://localhost/wordpress/wp-content/uploads/2019/02/2-150x150.jpg 150w\" sizes=\"(max-width: 204px) 100vw, 204px\" />											\n				<p>\n					I was introduced to FitFlex many years ago, twenty pounds ago in fact. I see a huge benefit with their combination of workout and goal setting.\n				</p>\n				<p>Emma Velasquez</p>\n			<h3>Choose Your PLAN</h3>		\n		<p>Pick a program that best fits your schedule and goals. All plans offer a full money back guarantee.</p>		\n			<h3>Starter</h3>		\n			<h2>$29</h2>		\n		<p>/month</p>		\n			<p>Open Gym</p>		\n			<p>Gymnastics</p>		\n			<p>CrossFit</p>		\n			<p>Yoga</p>		\n			<p>Personal Trainer</p>		\n			<a href=\"#\" role=\"button\">\n						Start Today\n					</a>\n			<h3>Basic</h3>		\n			<h2>$49</h2>		\n		<p>/month</p>		\n			<p>Open Gym</p>		\n			<p>Gymnastics</p>		\n			<p>CrossFit</p>		\n			<p>Yoga</p>		\n			<p>Personal Trainer</p>		\n			<a href=\"#\" role=\"button\">\n						Start Today\n					</a>\n			<h3>Pro</h3>		\n			<h2>$99</h2>		\n		<p>/month</p>		\n			<p>Open Gym</p>		\n			<p>Gymnastics</p>		\n			<p>CrossFit</p>		\n			<p>Yoga</p>		\n			<p>Personal Trainer</p>		\n			<a href=\"#\" role=\"button\">\n						Start Today\n					</a>', 'Home', '', 'inherit', 'closed', 'closed', '', '21-revision-v1', '', '', '2019-02-13 04:26:26', '2019-02-13 04:26:26', '', 21, 'http://localhost/wordpress/2019/02/13/21-revision-v1/', 0, 'revision', '', 0),
