ef=\'http://localhost/wordpress/wp-content/uploads/2019/02/3-2.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/3-2-150x150.jpg\" alt=\"\" /></a>\n			</dt></dl><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"e1643fb\" href=\'http://localhost/wordpress/wp-content/uploads/2019/02/2-2.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/2-2-150x150.jpg\" alt=\"\" /></a>\n			</dt></dl><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"e1643fb\" href=\'http://localhost/wordpress/wp-content/uploads/2019/02/photo-1491956142110-8a4226a12077-2.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/photo-1491956142110-8a4226a12077-2-150x150.jpg\" alt=\"\" /></a>\n			</dt></dl><br style=\"clear: both\" /><dl class=\'gallery-item\'>\n			<dt class=\'gallery-icon landscape\'>\n				<a data-elementor-open-lightbox=\"default\" data-elementor-lightbox-slideshow=\"e1643fb\" href=\'http://localhost/wordpress/wp-content/uploads/2019/02/groomsman3.jpg\'><img width=\"150\" height=\"150\" src=\"http://localhost/wordpress/wp-content/uploads/2019/02/groomsman3-150x150.jpg\" alt=\"\" srcset=\"http://localhost/wordpress/wp-content/uploads/2019/02/groomsman3-150x150.jpg 150w, http://localhost/wordpress/wp-content/uploads/2019/02/groomsman3.jpg 234w\" sizes=\"(max-width: 150px) 100vw, 150px\" /></a>\n			</dt></dl>\n			<br style=\'clear: both\' />\n			<a href=\"#\" role=\"button\">\n						See all posts\n					</a>\n							<a href=\"\" target=\"_blank\">\n					Facebook\n				</a>\n							<a href=\"\" target=\"_blank\">\n					Twitter\n				</a>\n							<a href=\"\" target=\"_blank\">\n					Google-plus\n				</a>\n			<h2> 2019 GLOBAL FASHION 2017\n</h2>', 